import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <Container
        maxWidth="sm"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "40vh",
          width: "40vh",
          backgroundColor: "red",
        }}
      >
        <Grid container spacing={2} sx={{ flexGrow: 1 }}>
          <Grid xs={12} md={12}>
            <Item>Login</Item>
          </Grid>
          <Grid xs={12} md={12}>
            <Input placeholder="Type your Username" variant="soft" />
          </Grid>
          <Grid xs={6} md={4}>
            <Input placeholder="Type your Password" variant="soft" />
          </Grid>
          <Grid xs={6} md={8}>
            <Item>xs=6 md=8</Item>
          </Grid>
        </Grid>
        <Input placeholder="Type your Username" variant="soft" />
        <Input placeholder="Type your Password" variant="soft" />
      </Container>
    </Container>
  );
}
